import home from "./baseAxios";
import { HEALTH_TOPIC_URL } from "./apiConstants";
import {
  fetchAllHealthTopicsError,
  fetchAllHealthTopicsPending,
  fetchAllHealthTopicsSuccess,
} from "../redux/actions/home";

export const fetchHealthTopics = () => {
  return async (dispatch, getState) => {
    dispatch(fetchAllHealthTopicsPending());
    try {
      const response = await home.get(HEALTH_TOPIC_URL);
      console.log(response.data);
      dispatch(fetchAllHealthTopicsSuccess(response.data));
    } catch (err) {
      console.log(err);
      dispatch(fetchAllHealthTopicsError(err));
    }
  };
};

